import React, { Component } from 'react';


export default React.createContext({
    bigcards:[
        {title:'Hello', alt:"img", src:"aaa" , btn:'Zobacz zjdecia sali'},
        {title:'Hi', alt:"isssg", src:"aasssa", btn:'Zobacz zjdecia kosciola'},
    ]
})
